import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  background-color: #f4f4f4;
  width: 100%;
  height: 722px;
  & > div {
    width: 993px;
    margin: 0 auto;
    height: 100%;
  }
`;
function NoticeSection() {
  return (
    <Wrapper>
      <div></div>
    </Wrapper>
  );
}

export default NoticeSection;
